  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Rice Lake
  National Wildlife Refuge (including the Sandstone Unit) and Mille Lacs National
  Wildlife Refuge summarizes activities during the 1994 calendar year. The report
  begins with a summary of the yearu2019s highlights and climatic conditions. Land
  acquisition is also covered. The report includes a planning section which discusses
  the master plan, the management plan, public participation, research, and investigations.
  Refuge administration is outlined; information about personnel, youth programs,
  manpower programs, volunteer programs, funding, safety, and technical assistance
  is given. Habitat management is also covered. Subjects include wetlands, forests,
  croplands, grasslands, haying, fire management, pest control, and private lands.
  The wildlife section of the report discusses wildlife diversity, endangered species,
  threatened species, waterfowl, marsh birds, waterbirds, shorebirds, raptors, game
  mammals, and fisheries resources. The public uses of the Refuge described in this
  report include outdoor classrooms, interpretive exhibits, hunting, fishing, trapping,
  wildlife observation, camping, and law enforcement. The equipment and facilities
  section of the report provides information about new construction, rehabilitation,
  major maintenance, equipment utilization and replacement, computer systems, and
  energy conservation. Cooperative programs, other economic uses of the Refuge, and
  items of interest are provided at the end. Refuge brochures are attached.\",\n\t\"owner_org\":
